--Inserindo os módulos(telas) do sistema  que serão usados nas permissões de acesso
--Inserindo os operações(botões) existentes no sistema que serão usados nas permissões de acesso
--Inserindo dados para juntar as tabelas anterioes(módulo+operação)
-- Operações modulo

-- Permissoes para o colaborador inicial criado(usuario admin)
select colaborador.id,    
       op.id, 
	   CASE WHEN (( op.id % 2 ) = 0) 
	    	THEN true
			ELSE true
	   END
  from colaborador, operacoesmodulo op;

-- Inserindo na tabela realease(contra as versões do sistema) a versão inicial
--Insere na tabela de visualização das alterações de cada versão, a conexão usuário admin e versão 1
select release.id, colaborador.id, false
from release, colaborador
where not exists (select * from visualizacaorelease v where v.release = release.id);
